import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Components
import PageTitle from '../components/PageTitle';
import Filters from '../components/Filters';
import Items from '../components/views/Items';
// Utils
import { keyitems, keyitemsGen, keyitemsFilters } from '../utils/items/keyitems';

const styles = theme => ({
  root: {
    width: '100%',
  },
  wrapper: {
    maxWidth: 1020,
    margin: 'auto',
  },
});

function KeyItems(props) {

  const { classes } = props;
  const pagetitle = 'Key Items';

  return (
    <div className={classes.root}>
      <PageTitle pagetitle={pagetitle} />
      <div className={classes.wrapper}>
        <Filters dataFilters={keyitemsFilters} />
        <Items data={keyitems} dataGeneral={keyitemsGen} />
      </div>
    </div>
  );

}

KeyItems.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(KeyItems);
